import React from "react";
import NavBar from "./navbar";
import red from "./red.png";
import green from "./green.png"

class Overview extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            date: '',
        };
        this.handleClick = this.handleClick.bind(this);
    }

    componentDidMount() {
        var that = this;
        var date = new Date().getDate(); //Current Date
        var month = new Date().getMonth() + 1; //Current Month
        if(month < 10){ month = "0"+month }
        var year = new Date().getFullYear(); //Current Year
        var hours = new Date().getHours(); //Current Hours
        if(hours < 10){ hours = "0"+hours }
        var min = new Date().getMinutes(); //Current Minutes
        if(min < 10){ min = "0"+min }
        var sec = new Date().getSeconds(); //Current Seconds
        if(sec < 10){ sec = "0"+sec }
        that.setState({
            //Setting the value of the date time
            date:
                year + '-' + month + '-' + date +'T' + hours + ':' + min + ':' + sec+"+02:00",
        });
    }

    handleClick(event) {
        this.props.history.push('/');
    }

    active(param) {
        if(Date.parse(param) < Date.parse(this.state.date)){
            return <img src={ red } alt="" height="30" width="30" />
        }else {
            return <img src={green} alt="" height="30" width="30"/>
        }
    }

    render() {
        return (
            <div className="overview">
                <div className="navBar">
                <NavBar />
                </div>
                <div className="register_box" >
                    <h2 className="text-center text-white">Oversikt</h2>
                    <br></br>
                    <table className="table table-dark" >
                        <thead>
                        <tr>
                            <th scope="col">Status</th>
                            <th scope="col">#</th>
                            <th scope="col">Melding</th>
                            <th scope="col">Gyldighet</th>
                            <th scope="col">Type</th>
                            <th scope="col"></th>
                        </tr>
                        </thead>
                        <tbody>
                        {(JSON.parse(localStorage.getItem("issues"))).PtSituationElement.map((item, key) => (
                            <tr key={item.SituationNumber}>
                                <th>{this.active(item.ValidityPeriod.EndTime)}</th>
                                <th>{item.SituationNumber.split(":").pop()}</th>
                                <td>{item.Summary['@Value']}</td>
                                <td>{item.ValidityPeriod.StartTime} til {item.ValidityPeriod.EndTime}</td>
                                <td>Ikke gjort enda</td>
                                <td><a href="https://www.w3schools.com">Endre</a></td>

                            </tr>
                        ))}
                        </tbody>
                    </table>
                    <button onClick={this.handleClick} type="submit" className="btn btn-warning btn-lg btn-block">Tilbake</button>
                </div>
            </div>
        );
    }
}

export default Overview;
